import React, { useState } from 'react';
import Inscription from './Components/Inscription';
import Connexion from './Components/Connexion';

function App() {
    const [afficherInscription, setAfficherInscription] = useState(true);

    return (
        <div>
            {afficherInscription ? (
                <>
                    <Inscription />
                    <p>
                        Vous avez déjà un compte?{" "}
                        <button onClick={() => setAfficherInscription(false)}>Connexion</button>
                    </p>
                </>
            ) : (
                <>
                    <Connexion />
                    <p>
                        Pas de compte?{" "}
                        <button onClick={() => setAfficherInscription(true)}>S'inscrire</button>
                    </p>
                </>
            )}
        </div>
    );
}

export default App;
